  \"2016-07-27T23:01:54.742894\",\n\t\"name\": \"bird-and-mammal-observations-at-nizki-and-alaid-islands-aleutian-islands-alaska-spring-and\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Nizki and Alaid islands (Fig. 1) were selected
  as a study area in 1975 to document the response of native bird populations after
  removal of introduced arctic foxes (Alopex lagopus). Fox removal was planned for
  a number of Aleutian Islands to restore native birds including Aleutian Canada geese
  (Branta canadensis leucopareia), but resources precluded tracking the effects of
  this management action at all sites. Foxes were removed from Nizki and Alaid in
  1975 and 1976, and periodic bird surveys have been conducted subsequently to evaluate
  trends. In1990 we visited Nizki and Alaid to assess trends in nesting species over
  the past 15 years. This report summarizes our findings.\",\n\t\"license_title\":
